userDefinedLinkHintCss:
div > .vimiumHintMarker {
    font-family: monospace !important;
    background: #282a36;
    font-size: 12px;
    border: 0.25em solid #ffb86c;
    border-radius: 0.34em;
    box-shadow: 0em 0.1em 0.6em 0.1em rgba(0, 0, 0, 0.4);
}

div > .vimiumHintMarker span {
    font-family: monospace !important;
    color: #f8f8f2;
    font-size: inherit;
    text-shadow: none;
}

div > .vimiumHintMarker > .matchingCharacter {
    font-family: monospace !important;
    color: #6272a4;
}

div.vimiumHUD {
    font-family: monospace !important;
    background: #282a36;
    border: 1px solid #6272a4;
}

div.vimiumHUD .vimiumHUDSearchArea {
    font-family: monospace !important;
    background: #282a36;
}

div.vimiumHUD .hud-find {
    font-family: monospace !important;
    background: #282a36;
    border: none;
    color: #f8f8f2;
}

div.vimiumHUD span#hud-find-input{
    font-family: monospace !important;
    color: #f8f8f2;
}

div.vimiumHUD span#hud-match-count {
    font-family: monospace !important;
    color: #6272a4;
}

div.vimiumHUD .vimiumHUDSearchAreaInner {
    font-family: monospace !important;
    color: #6272a4;
}

#vomnibar{
    font-family: monospace !important;
    background-color: #44475A;
}

#vomnibar input {
    font-family: monospace !important;
    color: #f8f8f2;
    font: -moz-window;
    font-size: 20px;
    height: 34px;
    margin-bottom: 0;
    padding: 4px;
    background-color: #282a36;
    border-radius: 3px;
    border: 1px solid #6272a4;
    box-shadow: #bd93f9 0px 0px 1px;
    width: 100%;
    outline: none;
    box-sizing: border-box;
}

#vomnibar .vomnibarSearchArea {
    font-family: monospace !important;
    display: block;
    padding: 10px;
    background-color: #6272a4;
    border-radius: 4px 4px 0 0;
    border-bottom: 0px solid #bd93f9;
}

#vomnibar ul {
    font-family: monospace !important;
    background-color: #44475a;
    border-radius: 0 0 4px 4px;
    list-style: none;
    padding-top: 0;
    padding-bottom: 0;
    margin-block-start: 2px;
    margin-block-end: 0px;
}

#vomnibar li {
    font-family: monospace !important;
    border-bottom: 1px solid #6272a4;
    line-height: 1.1em;
    padding: 7px 10px;
    font-size: 16px;
    color: #f8f8f2;
    position: relative;
    display: list-item;
    margin: auto;
}

#vomnibar li .vomnibarBottomHalf {
    font-family: monospace !important;
    font-size: 15px;
    margin-top: 3px;
    padding: 2px 0;
}

#vomnibar li .vomnibarSource {
    font-family: monospace !important;
    color: #bd93f9;
    margin-right: 4px;
}

#vomnibar li .vomnibarRelevancy {
    font-family: monospace !important;
    position: absolute;
    right: 0;
    top: 0;
    padding: 5px;
    background-color: #282a36;
    color: #f8f8f2;
    font-family: monospace;
    width: 100px;
    overflow: hidden;
}

#vomnibar li .vomnibarUrl {
    font-family: monospace !important;
    white-space: nowrap;
    color: #50fa7b;
}

#vomnibar li .vomnibarMatch {
    font-family: monospace !important;
    font-weight: bold;
    color: #ffb86c;
}

#vomnibar li em, #vomnibar li .vomnibarTitle {
    font-family: monospace !important;
    color: #f8f8f2;
    margin-left: 4px;
    font-weight: normal;
}

#vomnibar li em {
    font-family: monospace !important;
    font-style: italic;
}

#vomnibar li em .vomnibarMatch, #vomnibar li .vomnibarTitle .vomnibarMatch {
    font-family: monospace !important;
    color: #ffb86c;
}

#vomnibar li.vomnibarSelected {
    font-family: monospace !important;
    background-color: #6272a4;
    font-weight: normal;
}

#vomnibarInput::selection {
    font-family: monospace !important;
    background-color: #8be9fd;
}
